import Link from "next/link";
import styles from './SideBarNav.module.css'

const SideBarNav = () => (
  <nav class="navbar p-0">
    <div className={styles.container}>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/search">
        <a>Search</a>
      </Link>
    </div>
  </nav>
);

export default SideBarNav;
